//------------------------------------------------------------------------------
void TCrvNumerology::Print(Option_t* Opt) const {
  printf ("N(sectors): %i\n",kNSectors);
  for (int i=0; i<kNSectors; i++) {
    printf("%3i %-10s %5i\n",i,fSector[i].fName.Data(),fSector[i].fFirstIndex);
  }
}
